tart_time = time.time()\n        sfm_result_graph = self.scene_optimizer.create_computation_graph(\n            num_images=len(self.loader),\n            image_pair_indices=self.loader.get_valid_pairs(),\n            image_graph=self.loader.create_computation_graph_for_images(),\n            camera_intrinsics_graph=self.loader.create_computation_graph_for_intrinsics(),\n            image_shape_graph=self.loader.create_computation_graph_for_image_shapes(),\n            gt_cameras_graph=self.loader.create_computation_graph_for_cameras(),\n            gt_scene_mesh=self.loader.gt_scene_trimesh,\n        )\n\n        # Create dask client.\n        cluster = LocalCluster(\n            n_workers=self.parsed_args.num_workers, threads_per_worker=self.parsed_args.threads_per_worker\n        )\n\n        # Run SfM pipeline.\n        with Client(cluster), performance_report(filename=\"dask-report.html\"):\n            sfm_result = sfm_result_graph.compute()\n        assert isinstance(sfm_result, GtsfmData)\n        logger.info(\"GTSFM took %.2f minutes to compute sparse multi-view result.\", (time.time() - start_time) / 60)\n\n        &lt;/pre&gt;\n        "},"id":"1390","type":"Div"},{"attributes":{},"id":"1405","type":"Title"},{"attributes":{"bottom_units":"screen","fill_alpha":0.5,"fill_color":"lightgrey","left_units":"screen","level":"overlay","line_alpha":1.0,"line_color":"black","line_dash":[4,4],"line_width":2,"right_units":"screen","syncable":false,"top_units":"screen"},"id":"1024","type":"BoxAnnotation"},{"attributes":{},"id":"1483","type":"BasicTickFormatter"},{"attributes":{},"id":"1420","type":"BasicTickFormatter"},{"attributes":{},"id":"1484","type":"AllLabels"},{"attributes":{},"id":"1421","type":"AllLabels"},{"attributes":{"mantissas":[1,2,5],"max_interval":500.0,"num_minor_ticks":0},"id":"1539","type":"AdaptiveTicker"},{"attributes":{},"id":"1423","type":"BasicTickFormatter"},{"attributes":{},"id":"1424","type":"AllLabels"},{"attributes":{},"id":"1403","type":"
